package Collection;

import java.util.ArrayDeque;

public class AD {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
  ArrayDeque ad=new ArrayDeque();
  ad.add("java");
  ad.addFirst(1);
  ad.addLast(4);
  System.out.println(ad);
  ArrayDeque ad2=new ArrayDeque();
  ad2.add("java");
  ad2.add(1);
  ad2.add(4);
  System.out.println(ad2);
  
	}

 }
